css:
@-moz-document domain("youtube.com")
{
:root {
color-scheme: dark;
}
  #logo-icon
  {
    content: url("https://cdn.discordapp.com/attachments/1035611915411542119/1098586668107321475/YouTulub.png") !important;
    width: auto;
    height: 50px;
    object-fit: cover;
  }

  ytd-topbar-logo-renderer
  {
    width: 0%;
  }
  
  #contents.ytd-rich-grid-renderer {
    margin-top: -6em;
}

#chips.ytd-feed-filter-chip-bar-renderer { 
    display: none; 
}

.yt-spec-touch-feedback-shape__fill {
    display: none;
}

.yt-spec-touch-feedback-shape--overlay-touch-response .yt-spec-touch-feedback-shape__stroke {
    display: none;
}
  
#country-code.ytd-topbar-logo-renderer {
  	display: none;
}
}
